cy.visit('http://automationexercise.com');
cy.get('body').should('be.visible');
RegistrationPage_1.default.signupLoginButton.click();
RegistrationPage_1.default.fillSignupForm(name, email);
RegistrationPage_1.default.clickSignupButton();
cy.wait(2000);
RegistrationPage_1.default.fillAccountInfo(password, 'Mrs', firstName, lastName, company, address1, address2, country, state, city, zipcode, mobileNumber);
RegistrationPage_1.default.clickCreateAccountButton();
RegistrationPage_1.default.accountCreatedMessage.should('be.visible');
RegistrationPage_1.default.continueButton.click();
cy.contains('Logged in as ' + name).should('be.visible');
ProductsPage_1.default.addFirstProductToCart();
ProductsPage_1.default.continueShoppingButton.click();
ProductsPage_1.default.cartButton.click();
cy.url().should('include', '/view_cart');
CheckoutPage_1.default.proceedToCheckoutButton.click();
CheckoutPage_1.default.deliveryAddress.should('contain', address1);
CheckoutPage_1.default.deliveryAddress.should('contain', address2);
CheckoutPage_1.default.deliveryAddress.should('contain', city + ' ' + state + ' ' + zipcode);
CheckoutPage_1.default.deliveryAddress.should('contain', country);
CheckoutPage_1.default.billingAddress.should('contain', address1);
CheckoutPage_1.default.billingAddress.should('contain', address2);
CheckoutPage_1.default.billingAddress.should('contain', city + ' ' + state + ' ' + zipcode);
CheckoutPage_1.default.billingAddress.should('contain', country);
RegistrationPage_1.default.deleteAccountButton.click();
RegistrationPage_1.default.accountDeletedText.should('be.visible');
RegistrationPage_1.default.continueButton.click();
